import{o as e,c as r,t as o}from"./app.746f22cf.js";const c='{"title":"chrome开发使用小技巧","description":"","frontmatter":{"title":"chrome开发使用小技巧","tag":["chrome"],"author":"Artiely","date":"2018-10-10","cover":"https://gitee.com/artiely/Figure-bed/raw/master/images/20200315162638.png","base64":"dc4a3b"},"headers":[{"level":2,"title":"chrome开启跨域","slug":"chrome开启跨域"},{"level":2,"title":"chrome与安卓设备联调H5页面","slug":"chrome与安卓设备联调h5页面"}],"relativePath":"post/2018/2018-10-10-chrome-dev-tips.md","lastUpdated":1629110799753}',a={},t=o('<h1 id="开发工具使用小技巧"><a class="header-anchor" href="#开发工具使用小技巧" aria-hidden="true">#</a> 开发工具使用小技巧</h1><h2 id="chrome开启跨域"><a class="header-anchor" href="#chrome开启跨域" aria-hidden="true">#</a> chrome开启跨域</h2><p>跨域的解决办法有很多</p><p>这里先来个简单暴力一劳永逸的办法</p><p>1.找到chrome的安装目录chrome.exe新建快捷方式</p><p>2.重命名快捷方式<code>跨域.exe</code>右键属性 目标 加入参数<code> --disable-web-security</code> 记得前面空格</p><p>3.快捷方式发送到桌面</p><blockquote><p>关闭所有chrome然后启动<code>跨域.exe</code> 会提示 您使用的是不受支持的命令行标记disable-web-security 安全和稳定性有所下降</p></blockquote><p>这样你就有了一个支持跨域的chrome</p><p>最新版本 需要新建一个文件用于储存用户信息 ,新建文件夹<code>MyChromeDevUserData</code><br><code>--disable-web-security --user-data-dir=C:\\MyChromeDevUserData</code></p><h2 id="chrome与安卓设备联调h5页面"><a class="header-anchor" href="#chrome与安卓设备联调h5页面" aria-hidden="true">#</a> chrome与安卓设备联调H5页面</h2><p>搜索栏键入<code>chrome://inspect/#devices</code></p><p>待续。</p>',13);a.render=function(o,c,a,h,d,i){return e(),r("div",null,[t])};export default a;export{c as __pageData};
